  `khoangCachSanBay` decimal(5,2) DEFAULT NULL COMMENT 'Khoảng cách đến sân bay (km)',
  `khoangCachTT` decimal(5,2) DEFAULT NULL COMMENT 'Khoảng cách đến trung tâm (km)',
  `diaDiemGanDay` text COLLATE utf8mb4_unicode_ci COMMENT 'JSON: Các địa điểm gần đây',
  PRIMARY KEY (`id`),
